import React, {useState} from 'react';
import {Box, Grid, Card, CardActionArea, CardActions, CardContent, CardMedia, Button, Typography} from '@material-ui/core' 
import {makeStyles} from '@material-ui/core/styles'
import Navbar from '../navbar/navbar'
import Typed  from 'react-typed'
const useStyles = makeStyles((theme) => ({
    mainContainer: {
        backgroundColor: 'white',
        height: '100%',
        paddingTop: '2rem',
        color: '#34495e'
    },
    headerContainer: {
        textAlign: 'center'
    },
    header: {
        fontSize: '1.3rem'
    },
    mainContent: {
        paddingTop: '3rem',
        height: '100%',
        textAlign: 'center'
    },

}))

const Intranet = (props) => {
    const classes = useStyles();
    return (
        <>
            <Navbar/>
            <Box component='div' className={classes.mainContainer}>
                <Box component='header' className={classes.headerContainer}>
                    <Typography className={classes.header}>
                        <Typed strings={['Welcome to the Intranet', 'Find out everything to do today!']} typeSpeed={40} backSpeed={60} loop/>
                    </Typography>
                    <Typography variant='h4'>Welcome to the Intranet</Typography>
                </Box>

                <Box component='div'>
                    <Grid container className={classes.mainContent}>
                        <Grid item lg={5}>
                            <Typography variant='h5'>Team 1</Typography>

                        </Grid>
                        <Grid item lg={5}>
                            <Typography variant='h5'>Team 2</Typography>
                        </Grid>
                    </Grid>

                </Box>
            </Box>
        </>
    )
}

export default Intranet
